import * as React from 'react';
import { Typography } from '@mui/material';
import Stack from '@mui/material/Stack';
import Button from '@mui/material/Button';
import { Box } from '@mui/material';
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormControl from '@mui/material/FormControl';
import Select from '@mui/material/Select';

const DocumentPage = () => {
    const [age, setAge] = React.useState('');

    const handleChange = (event) => {
        setAge(event.target.value);
    };

    return (
        <div>
            <Stack direction="row" justifyContent="space-between" alignItems="center" spacing={0.5} sx={{ margin: '2rem 1rem 1rem 1rem' }}>
                <Typography sx={{ fontSize: '2rem', color: '#185382' }}>Documents</Typography>
                <Box>
                    <Stack
                        direction="row"
                        justifyContent="center"
                        alignItems="center"
                        spacing={1}
                    >
                        <Button variant="contained" sx={{ backgroundColor: '#185382' }}>Probem</Button>
                        <Button variant="contained" sx={{ backgroundColor: '#185382' }}>Add note</Button>
                    </Stack>
                </Box>
            </Stack>
            <FormControl sx={{ m: 1, minWidth: 150, minHeight: 5 }} size="small">
                <InputLabel id="demo-select-small">Project</InputLabel>
                <Select
                    labelId="demo-select-small"
                    id="demo-select-small"
                    value={age}
                    label="Age"
                    onChange={handleChange}
                >
                    <MenuItem value="">
                        <em>None</em>
                    </MenuItem>
                    <MenuItem value={10}>Ten</MenuItem>
                    <MenuItem value={20}>Twenty</MenuItem>
                    <MenuItem value={30}>Thirty</MenuItem>
                </Select>
            </FormControl>


        </div>
    );
}
export default DocumentPage
